void read_input_data(const char* filename, data_t input[2][32][3072]) {
    std::ifstream file(filename, std::ios::binary);
    if (!file) {
        std::cerr << "Unable to open input file: " << filename << std::endl;
        return;
    }
    for (int c = 0; c < 2; c++) {
        for (int h = 0; h < 32; h++) {
            for (int w = 0; w < 3072; w++) {
                float value;
                file.read(reinterpret_cast<char*>(&value), sizeof(float));
                input[c][h][w] = value;
            }
        }
    }
    file.close();
}

void print_inference_results(data_t output[13]) {
    // max_val과 min_val의 타입을 data_t로 변경하여 output 배열과 동일한 타입으로 비교
    data_t max_val = -std::numeric_limits<data_t>::infinity();
    data_t min_val = std::numeric_limits<data_t>::infinity();
    float max_prob = -1.0f;
    int max_class = -1;
    float sum_exp = 0.0f;
    float probs[13];

    // 첫 번째 루프: output의 최댓값과 최솟값 찾기
    for (int i = 0; i < 13; ++i) {
        // data_t 타입끼리 비교하여 std::max/min 에러 해결
        max_val = std::max(max_val, output[i]);
        min_val = std::min(min_val, output[i]);
    }

    // 두 번째 루프: softmax 확률 계산
    for (int i = 0; i < 13; ++i) {
        // std::exp 함수는 float 또는 double 타입을 인자로 받으므로,
        // (output[i] - max_val) 연산 결과를 명시적으로 float으로 캐스팅
        probs[i] = std::exp(static_cast<float>(output[i] - max_val));
        sum_exp += probs[i];
    }

    std::cout << "=== Probability per class ===" << std::endl;
    for (int i = 0; i < 13; ++i) {
        float prob = probs[i] / sum_exp;
        std::cout << "Class " << i << ": " << std::fixed << std::setprecision(4) << prob * 100 << "%" << std::endl;
        if (prob > max_prob) {
            max_prob = prob;
            max_class = i;
        }
    }

    // 최종 결과 출력
    std::cout << "Final prediction: Class " << max_class
              << " (Probability: " << std::fixed << std::setprecision(2)
              << max_prob * 100 << "%)" << std::endl;
    // min_val과 max_val은 data_t 타입이므로 출력 시 float으로 캐스팅하여 정확한 값 표시
    std::cout << "Output stats: Min = " << static_cast<float>(min_val) << ", Max = " << static_cast<float>(max_val) << std::endl;
}

int main() {
    static data_t input[2][32][3072];
    static data_t output[13];

    static data_t stem_stem_0_Conv_output_0[12][32][3072];
    static data_t cells_0_preprocess0_op_op_0_Relu_output_0[12][32][3072];
    static data_t cells_0_preprocess0_op_op_1_Conv_output_0[8][32][3072];
    static data_t cells_0_preprocess1_op_op_1_Conv_output_0[8][32][3072];
    static data_t relu_buf[2][8][32][3072];  // CH0=8
    static data_t relu_half_buf[2][8][16][1536];  // half size
    static data_t conv_buf[4][8][16][1536];
    static data_t add_buf[4][8][16][1536];
    static data_t concat_buf[2][4][16][1536];  // CH0/2=4
    static data_t concat_out[8][16][1536];

    read_input_data("train06_trimmed.fc32", input);

    // === stem ===
    conv_layer<2, 12, 32, 3072, 32, 3072, 3, 1>(
        input, onnx_Conv_307, onnx_Conv_308, stem_stem_0_Conv_output_0, 1, 1, 1, 1);

    // === cell0 preprocess ===
    relu_layer<12, 32, 3072>(
        stem_stem_0_Conv_output_0, cells_0_preprocess0_op_op_0_Relu_output_0);
    conv_layer<12, 8, 32, 3072, 32, 3072, 1, 1>(
        cells_0_preprocess0_op_op_0_Relu_output_0, onnx_Conv_310, onnx_Conv_311, cells_0_preprocess0_op_op_1_Conv_output_0, 1, 0, 1, 1);
    conv_layer<12, 8, 32, 3072, 32, 3072, 1, 1>(
        cells_0_preprocess0_op_op_0_Relu_output_0, onnx_Conv_313, onnx_Conv_314, cells_0_preprocess1_op_op_1_Conv_output_0, 1, 0, 1, 1);

    static data_t cells_0_Concat_output_0[32][16][1536];


    cell0(
            cells_0_preprocess0_op_op_1_Conv_output_0,
            cells_0_preprocess1_op_op_1_Conv_output_0,
            cells_0_Concat_output_0,
            relu_buf,
            relu_half_buf,
            conv_buf,
            add_buf,
            concat_buf,
            concat_out
        );

    static data_t cells_1_preprocess1_op_op_0_Relu_output_0[32][16][1536];
    static data_t cells_1_preprocess0_conv1_Conv_output_0[8][16][1536];
    static data_t cells_1_preprocess0_conv2_Conv_output_0[8][16][1536];
    static data_t cells_1_preprocess0_Concat_output_0[16][16][1536];
    static data_t cells_1_preprocess0_bn_BatchNormalization_output_0[16][16][1536];
    static data_t cells_1_preprocess1_op_op_1_Conv_output_0[16][16][1536];

    // === cell1 preprocess ===
    conv_layer<12, 8, 32, 3072, 16, 1536, 1, 1>(
    	cells_0_preprocess0_op_op_0_Relu_output_0, cells_1_preprocess0_conv1_weight, nullptr, cells_1_preprocess0_conv1_Conv_output_0, 2, 0, 1, 1);
    conv_layer<12, 8, 32, 3072, 16, 1536, 1, 1>(
    	cells_0_preprocess0_op_op_0_Relu_output_0, cells_1_preprocess0_conv2_weight, nullptr, cells_1_preprocess0_conv2_Conv_output_0, 2, 0, 1, 1);
    concat2_layer<16, 16, 1536>(
    	cells_1_preprocess0_conv1_Conv_output_0, cells_1_preprocess0_conv2_Conv_output_0, cells_1_preprocess0_Concat_output_0);
    batchnorm_layer<16, 16, 1536>(
    	cells_1_preprocess0_Concat_output_0, cells_1_preprocess0_bn_weight, cells_1_preprocess0_bn_bias, cells_1_preprocess0_bn_running_mean, cells_1_preprocess0_bn_running_var, cells_1_preprocess0_bn_BatchNormalization_output_0);

    relu_layer<32, 16, 1536>(
        cells_0_Concat_output_0, cells_1_preprocess1_op_op_0_Relu_output_0);
    conv_layer<32, 16, 16, 1536, 16, 1536, 1, 1>(
        cells_1_preprocess1_op_op_0_Relu_output_0, onnx_Conv_343, onnx_Conv_344, cells_1_preprocess1_op_op_1_Conv_output_0, 1, 0, 1, 1);

   static data_t cells_1_Concat_output_0[64][8][768];

    cell1(
        cells_1_preprocess0_bn_BatchNormalization_output_0,
        cells_1_preprocess1_op_op_1_Conv_output_0,
        cells_1_Concat_output_0
    );

    static data_t global_pooling_GlobalAveragePool_output_0[64];

    // === Global Pool ===
    global_avg_pool<64, 8, 768>(cells_1_Concat_output_0, global_pooling_GlobalAveragePool_output_0);
    gemm_layer_1d<13, 64>(global_pooling_GlobalAveragePool_output_0, classifier_weight, classifier_bias, output);

    print_inference_results(output);
    return 0;
}
